INSERT INTO public.directus_revisions (id, activity, collection, item, data, delta, parent, version) VALUES (1189, 1212, 'dojos', '1', '{"id":1,"status":"published","sort":null,"name":"Bishamonten Naginata Kyoshitsu","logo":"554e360b-8cac-4e87-b614-98bf61810e0b","link":"https://naginatasport.de/","city":"Potsdam","description":"<p>Wir sind die Erste Naginatagruppe Land Brandenburg - werden oft auch vereinfacht Naginatagruppe Potsdam genannt.<br>Seit 2012 trainieren wir in Potsdam die japanische Kampfkunst Naginata. Diese wird zu 100 % mit der antiken Langwaffe namens Naginata ausge&uuml;bt. Historische Funde zeigen, dass diese beeindruckende Waffe bereits vor &uuml;ber 1200 Jahren in Japan genutzt wurde - von K&auml;mpfern zu Fu&szlig; aber auch von berittenen Kriegern.</p>\n<p>Unser Training findet zweimal in der Woche&nbsp;<a class=\"cm_anchor\" href=\"https://naginatasport.de/Dein-Weg-zu-uns/\">in Potsdam-Babelsberg</a>&nbsp;statt. Bist Du an einem kostenfreien Probetraining interessiert, gib uns einfach einige Tage vorher Bescheid und es kann losgehen. Trainieren wirst Du dann barfu&szlig; in einer sauberen Turnhalle.</p>\n<p>Auf unserer Seite findest Du weitere Informationen &uuml;ber uns als Gruppe; Aktuelle Termine und Veranstaltungen bieten Dir einen Vorgeschmack auf baldige Aktivit&auml;ten und eine Wegbeschreibung, wie Du ganz einfach zu unserem Training finden kannst, haben wir ebenfalls f&uuml;r Dich bereitgestellt.</p>\n<p>Solltest Du noch Fragen haben kontaktiere uns einfach &uuml;ber die Kontaktm&ouml;glichkeit auf der linken Seite.</p>","coordinates":{"type":"Point","coordinates":[13.105460518249089,52.38511112510804]}}', '{"coordinates":{"type":"Point","coordinates":[13.105460518249089,52.38511112510804]}}', NULL, NULL);
INSERT INTO public.directus_revisions (id, activity, collection, item, data, delta, parent, version) VALUES (1190, 1213, 'dojos', '2', '{"id":2,"status":"published","sort":null,"name":"PSV Mainz","logo":"1c171e85-9040-4be1-9b31-88636e82932d","link":"https://www.psv-mainz.de/de/sportarten/naginata/","city":"Mainz","description":"<p>Wir sind&nbsp; Naginata-Fans, die eine Gruppe mit regelm&auml;&szlig;igem Trainingsangebot im November 2005 gegr&uuml;ndet haben. Mittlerweile sind unsere Naginata-K&auml;mpfer national und international erfolgreich und trainieren an bis zu drei Tagen in der Woche miteinander. Derzeit k&uuml;mmern sich zwei Lehrer um das Wohlergehen der Gruppe. Dabei ist uns nicht nur der Erfolg auf Turnieren, sondern vor allem der Spa&szlig; am Naginata und das Miteinander wichtig.</p>\n<p>Die meisten von uns sind Mitglieder im Deutschen Naginata Bund (DNagB) und damit auch im europ&auml;ischen und internationalen Naginata-Dachverband (ENF und INF). Dadurch bietet sich uns die M&ouml;glichkeit, an Wettk&auml;mpfen und Seminaren auf weltweiter Ebene teilzunehmen und Bekanntschaften zu kn&uuml;pfen.</p>","coordinates":{"type":"Point","coordinates":[8.271543586089365,50.00066278392802]}}', '{"coordinates":{"type":"Point","coordinates":[8.271543586089365,50.00066278392802]}}', NULL, NULL);
